import "./App.css";
import { BrowserRouter, Routes, Route } from "react-router-dom";
import Home from "./Home";
import Login from "./Login";
import SignUp from "./SignUp";
import Protecting from "./Protecting";
import { useEffect, useState } from "react";

function App() {
  return (
    <div className="App">
      <BrowserRouter>
        <Routes>
          <Route
            path="/"
            element={
              <Protecting>
                <Login />
              </Protecting>
            }
          />

          <Route
            Component={localStorage.getItem("accessToken")}
            path="/Login"
            element={<Login />}
          />
          <Route path="/SignUp" element={<SignUp />} />
          <Route
            path="/Home"
            element={
              <Protecting>
                <Home />
              </Protecting>
            }
          />
        </Routes>
      </BrowserRouter>
    </div>
  );
}

export default App;
